import React from "react";
import { colors, fontSizes } from "../constants";

function UIHeader(props: any) {
    const { onPress, title, isSelected } = props;
    return (
        <View style={{
            height: 60,
            backgroundColor: colors.primary
        }}>
            <Text
                style={{
                    fontSize: fontSizes.h5,
                    color: 'white',
                    lineHeight: 45,
                    alignSelf: 'center'
                }}
            >
                Settings
            </Text>
        </View>
    )
}

export default UIHeader;
